var title_f12_56_13189="ECG type II sinoatrial block";
var content_f12_56_13189=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F54936&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F54936&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1056px;\">",
"  <div class=\"figure\" style=\"width: 486px\">",
"   <div class=\"ttl\">",
"    Single-lead electrocardiogram (ECG) showing lead V5 in type II sinoatrial block",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 466px; height: 87px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    There is a 3:2 SA block, resulting in group beating of pairs of sinus beats. The P-P interval during the pause has a duration (1840 msec) that is approximately equal to two P-P cycles (920 msec); this finding distinguishes this arrhythmia from type I SA block in which the pause duration is less than that of two P-P cycles. There may be some sinus variability, as in this case, due to sinus arrhythmia and possibly to baroreceptor responses to varying diastolic filling intervals.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Morton Arnsdorf, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal rhythm strip",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 165px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal rhythm strip in lead II. The PR interval is 0.15 sec and the QRS duration is 0.08 sec. Both the P and T waves are upright.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Morton F Arnsdorf, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
