"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"4\" width=\"25%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Syndrome",
"       </td>",
"       <td class=\"subtitle1\">",
"        Associated clinical features",
"       </td>",
"       <td class=\"subtitle1\">",
"        Chromosomal location",
"       </td>",
"       <td class=\"subtitle1\">",
"        Pancreatic neuroendocrine tumor type",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        MEN1",
"       </td>",
"       <td>",
"        <p class=\"indent1\">",
"         Primary hyperparathyroidism",
"        </p>",
"        <p>",
"         Pituitary tumors",
"        </p>",
"        Less commonly",
"        <br/>",
"        <ul>",
"         <li>",
"          Adrenocortical tumors",
"         </li>",
"         <li>",
"          Carcinoid tumors",
"         </li>",
"         <li>",
"          Nonmedullary thyroid tumors",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        11q13",
"       </td>",
"       <td>",
"        <p>",
"         Nonfunctional",
"        </p>",
"        <p>",
"         Gastrinoma",
"        </p>",
"        <p>",
"         Insulinoma",
"        </p>",
"        Various",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Von Hippel-Lindau disease (VHL)",
"       </td>",
"       <td>",
"        <p>",
"         Pheochromocytoma (often bilateral)",
"        </p>",
"        <p>",
"         Retinal and cerebellar hemangioblastomas",
"        </p>",
"        Renal cell carcinoma",
"       </td>",
"       <td>",
"        3p25-26",
"       </td>",
"       <td>",
"        <p>",
"         Nonfunctional",
"        </p>",
"        Various, including cystic tumors",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Neurofibromatosis 1",
"        <br/>",
"        (von Recklinghausen disease)",
"       </td>",
"       <td>",
"        <p>",
"         Neurofibromas",
"        </p>",
"        <p>",
"         Caf&eacute; au lait spots",
"        </p>",
"        Pheochromocytoma",
"       </td>",
"       <td>",
"        17q11.2",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tuberous sclerosis",
"       </td>",
"       <td>",
"        <p>",
"         Cardiac rhabdomyomas",
"        </p>",
"        <p>",
"         Renal cysts",
"        </p>",
"        Angiomyolipomas",
"       </td>",
"       <td>",
"        9q33.34 and 16p13.3",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
